require('dotenv').config()
import express from 'express';
import mongoose from 'mongoose';
var nodemailer = require('nodemailer');
const router = express.Router();

var transporter = nodemailer.createTransport({
  service: 'gmail',
  auth: {
     user: process.env.EMAIL_USER,
	 pass: process.env.EMAIL_PASSWORD
  }
});

export function sendEmail(email,message){
	var mailOptions = {
	  from: process.env.EMAIL_USER,
	  to:process.env.EMAIL_USER,
	  subject: 'Get in touch',
	  text: `Hei, you got a get in touch message from ${email} -- ${message}`
	};

  transporter.sendMail(mailOptions, function(error, info){
  if (error) {
    console.log(error);
  } else {
    console.log('Email sent: ' + info.response);
  }
});
}

router.post('/getintouch',(req,res)=>{
	let email = req.body.data.email;
	let message = req.body.data.message;
	sendEmail(email,message);
	res.json({message:"Thank you. Your message has been recorded. We will get back to you soon"});
});




export default router;
